import React from 'react'
import {
    FadribbbleSquare,
    FaFacebookSquare,
    FaGithubSquare,
    FaTwitterSquare,
} from 'react-icons/fa'

const Footer = () => {
  return (
    <div className='max-w-[1240px] mx-auto py-16  px-4 grid lg:grid-cols-3 gap-8 text-gray-300'>
        <div>
            <h1 className='w-full text-3xl font-bold text-[#00df9a]'>REACT.</h1>
        </div>
      
    </div>
  )
}

export default Footer
